import './SpotCard.css'


const SpotCard = ({spot}) => {
    console.log(spot)


    return(
    <div>
        <li key={spot.id}>
            {spot.name}
            <img src={spot.previewImage} className='spot-image'/>
            <p>{spot.city}, {spot.state}</p>
            <p>{spot.price} </p>
        </li>
    </div>
    )
}

export default SpotCard
